事务的基本介绍 概念: 如果一个包含多个步骤的业务操作被事务管理, 要么这些操作同时成功, 或者同时失败. 操作 开启事务 start transaction 回滚: rollback 提交: commit 例子 CREATE TABLE `account` ( `id` int(11) NOT NULL AUTO_INCREMENT, `name` varchar(10) COLLATE utf8mb4_general_ci DEFAULT NULL, `balance` double DEFAULT NULL, PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci; -- 开启事务
START TRANSACTION;
UPDATE account SET balance = balance - 500 WHERE name = "张三";
UPDATE account SET balance = balance - 500 WHERE name = "李四";
-- 如果出错
ROLLBACK;
-- 如果没错
COMMIT; MySQL数据库中事务默认自动提交 事务提交的两种方式 自动提交 MySQL就是自动提交的 一条DML(增删改)语句会自动提交一次事务 手动提交: Oracle数据库默认是手动提交事务 需要先开启事务再提交 修改事务的默认提交方式 查看事务的默认提交方式: SELECT @@autocommit; 修改事务的默认提交方式: set @@autocommit = 1; 1开启自动提交, 0关闭自动提交 事务的四大特征 原子性: 是不可分割的最小单位, 要么同时成功, 要么同时失败. 持久性: 当事务提交或回滚后, 数据库会持久化的保存数据. 隔离性: 多个事务之间, 相互独立. 一致性: 开始和结束之间的状态不会被其他事务看到. 事务的隔离级别(了解) 概念: 多个事务是隔离的, 相互独立的. 但是如果多个事务操作同一批数据, 则会引发一些问题,设置不同的隔离级别就可以解决这些问题. 存在的问题: 脏读: 一个事务读取到另一个事务没有提交的数据 不可重复读(虚读): 在同一个事务中, 两次读取的数据不一样. 幻读: 数据表中所有的记录, 另一个事物添加了一条数据, 则第一个事务查询不到自己的修改. 隔离级别: read umcommited: 读未提交 产生的问题: 脏读, 不可重复读, 幻读 read commited: 读已提交 产生的问题: 不可重复读, 幻读 repeatable read: 可重复读 产生的问题: 幻读 serializable: 串行化 可以解决所有问题 注意: 隔离级别从小到大安全性越来越高, 但是性能越来越低 数据库查询隔离级别: select @@transaction_isolation; 设置数据库隔离级别: SET transaction_isolation = value; set global transaction isolation level read uncommitted; start transaction; -- 转账操作 update account set balance = balance - 500 where id = 1; update account set balance = balance + 500 where id = 2;

